CREATE DEFINER=`pics_admin`@`%` PROCEDURE `dw_calc_report_suggestions`()
BEGIN
    
	UPDATE report_user
	JOIN (
		SELECT userID, AVG(IFNULL(viewCount, 0)) avgCount, SUBDATE(NOW(), AVG(DATEDIFF(NOW(), IFNULL(lastViewedDate, creationDate)))) avgDate
		FROM report_user GROUP BY userID
	) myViews ON myViews.userID = report_user.userID
	SET score = favorite + (viewCount > myViews.avgCount) + IFNULL(lastViewedDate > myViews.avgDate, 0);
	
	TRUNCATE TABLE report_group_suggestion;
	INSERT INTO report_group_suggestion
	SELECT ug.groupID, ru.reportID, SUM(ru.score) / ug.usersInGroup
	FROM report_user ru
	JOIN calc_inherited_user_group ug ON ug.userID = ru.userID
	GROUP BY groupID, reportID
	HAVING SUM(ru.score) > 0;
    END ;;
DELIMITER ;
