CREATE DEFINER=`pics_admin`@`%` PROCEDURE `MergeOperatorContractorLists`(in vi_opSource char (64), in vi_opTarget char (64))
BEGIN
	create temporary table if not exists temp_gap_contractors (
		id INT(11) NOT NULL,
		conID mediumint(9) not null);
	
	insert into temp_gap_contractors (id, conID)
	select id, subID
	from generalcontractors
	where genID = vi_opSource
	and subID not in (select subID from generalcontractors where genID = vi_opTarget);
	
	insert into generalcontractors
	(genID, subID, createdBy, creationDate, updatedBy, updateDate, workStatus, flag, waitingOn, relationshipType, processCompletion, contractorType,
	baselineFlag, baselineApprover, baselineApproved, flagDetail, baselineFlagDetail)
	select vi_opTarget, t.conID, gc.createdBy, gc.creationDate, 1, now(), gc.workStatus, gc.flag, gc.waitingOn, gc.relationshipType, gc.processCompletion,
		gc.contractorType, gc.baselineFlag, gc.baselineApprover, gc.baselineApproved, gc.flagDetail, gc.baseLineFlagDetail
	from temp_gap_contractors t
	JOIN generalcontractors gc ON gc.id = t.id;
	
	insert into note 
	(accountID, creationDate, createdBy, updateDate, updatedBy, summary, noteCategory, priority, viewableBy, canContractorView, status, body)
	select t.conID, now(), 1, now(), 1, concat('Merged from ', sourceName) summary, 'OperatorChanges', 2, 
		vi_opTarget as viewableBy, 1, 2 as status, concat('Moved into contractor list for ', targetName) as body
	from temp_gap_contractors t, 
	(SELECT name sourceName from accounts WHERE id = vi_opSource) source, 
	(SELECT name targetName from accounts WHERE id = vi_opTarget) target;
	
	update contractor_info ci 
	set needsRecalculation = needsRecalculation+1 
	where ci.id in (select conID from temp_gap_contractors);
	delete from generalcontractors where genID = vi_opSource;
	update accounts set status = 'Deleted' where ID = vi_opSource;
	DROP temporary table temp_gap_contractors;
    END ;;
DELIMITER ;
