CREATE DEFINER=`pics_admin`@`%` PROCEDURE `reindexTrades`(IN inParentID INT, IN inStart INT, IN inLevel INT, OUT counter int)
BEGIN
DECLARE done BOOL DEFAULT FALSE;
DECLARE outEnd, cur_id, cur_level, cur_start, cur_end INT;
DECLARE cur_trade CURSOR FOR 
SELECT id, indexLevel, indexStart, indexEnd FROM ref_trade
WHERE parentID = inParentID;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
OPEN cur_trade;
SET max_sp_recursion_depth=10;
SET counter = inStart;
myLoop: LOOP
	FETCH cur_trade INTO cur_id, cur_level, cur_start, cur_end;
	IF done THEN
		CLOSE cur_trade;
		LEAVE myLoop;
        END IF;
	CALL reindexTrades(cur_id, counter + 1, inLevel + 1, @res);
	SET counter = @res;
END LOOP;
SET counter = counter + 1;
UPDATE ref_trade SET indexLevel = inLevel, indexStart = inStart, indexEnd = counter
WHERE id = inParentID;
END ;;
DELIMITER ;
